  \"Carp Control Study - Control Methods and Their Application to Malheur National
  Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:06:22.754246\",\n\t\"name\": \"carp-control-study-control-methods-and-their-application-to-malheur-national-wildlife-refu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study grew out of a need for information
  regarding alternative solutions to chemical control of carp in Malheur Lake. Of
  particular concern has been the feasibility of partial carp control during highwater
  cycles. A review of carp control methods and their effectiveness in Malheur Lake
  has been discussed in an earlier report (USDI, 1977a). The information gathered
  in that report pointed out that physical removal of carp in Malheur Lake was impractical.
  The conclusions drawn were that under high water conditions the only partial control
  methods available were rotenone treatment of spawning area and winter schooling
  areas.The overall study objective of this report is to conduct applied research
  on aspects of the carp's behavior in Malheur Lake. The objectives primarily concern
  the seasonal abundance, distribution, and movement patterns of carp in Malheur Lake;
  the ability of predator fish to control carp recruitment in Malheur Lake; the success
  of partial control attempts with rotenone in Malheur Lake; and the development of
  control programs for the water systems of Malheur Refuge.\",\n\t\"license_title\":
